import { ResponsiveContainer, LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip } from 'recharts';
import {useEffect} from "react"

export default function Chart() {
    const data = [
        {
            name: 'Page A', uv: 400, pv: 1400, amt: 1800
        },
        {
            name: 'Page B', uv: 500, pv: 2500, amt: 1600
        },
        {
            name: 'Page C', uv: 800, pv: 3600, amt: 2900
        },
        {
            name: 'Page D', uv: 700, pv: 1200, amt: 3200
        },
        {
            name: 'Page E', uv: 4095, pv: 4900, amt: 5600
        },
         ];
    return (
        <ResponsiveContainer width="100%" height="80%" >
        <LineChart data={data} margin={{right: 20}}>
            <Line type="monotone" dataKey="pv" stroke="#8884d8" />
            <Line type="monotone" dataKey="uv" stroke="red" />
            <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
        </LineChart>
  </ResponsiveContainer>
    )
}

